import React from "react";

//Create a header component using arrow function.

const Header = () => (
    <header className="jumbotron">
        <h1>Tic-Tac-Toe</h1>
        <hr></hr>
        <h4>Tic-tac-toe also known as "Noughts and Crosses" or 'Xs and Os', is a strategy game most often played by children.
        This game was used in the 1983 movie "WarGames" to teach a Super Computer (WOPR) that thermal nuculear war is a very  similar game;
        when played more often than not there is no winner and at best a stalemate is all you can hope for...</h4>
    </header>
);

export default Header;
